import { title } from "assets/jss/material-kit-react.js";

const productStyle = {
  section: {
    padding: "10px 0",
    textAlign: "center",
    minHeight: "800px"
  },
  title: {
    ...title,
    marginBottom: "1rem",
    marginTop: "30px",
    minHeight: "32px",
    textDecoration: "none"
  },
  description: {
    color: "#9999"
  }
};

export default productStyle;
